import React from "react";
import ProductDetail from "../Products/ProductDetail";

export default function ProductList(props) {
  const { items } = props;
  return (
    <div>
      {items.map((item) => (
        <ProductDetail key={item.id} item={item}></ProductDetail>
      ))}
    </div>
  );
}
